import React from 'react'
import './ImageMagage.css'
import { withRouter } from 'react-router-dom'
import {Card,Row,Col} from 'antd'
import BackBlogGround from './BackBlogGround'

/**
 * 我们照片的基本管理
 */
class ImageMagage extends React.Component{

    render(){

        return(
            <BackBlogGround
            leftSpan={0}
            rightSpan={24}
            extra={
                <Row gutter={[16,16]}>
                    <Col span={24}>
                        <Card 
                        title={"照片的管理"}
                        extra={
                            <div>您的位置：网站相册的维护</div>
                        }
                        >

                    {/* <TabbleUtils
                    key={this.state.tableKey}
                    columns={columns}
                    // searchParams={}
                    requestUrl={this.state.commentRequestUrl}
                    /> */}

                        </Card>
                    </Col>
                </Row>
            }
            />
        )
    }

}

export default withRouter(ImageMagage)
